		"text": "와 어두워진 후에도 그대로 마법 속에 있어라..불꽃놀이가 시작된다..? 이게 ㅋㅋㅋㅋ 무슨 ㅋㅋㅋㅋㅋㅋㅋ 그래놓고 부활의 신부같은 모습이라고..? 소름돋아 진짜 대작이겠다... https://t.co/6UWPopRGFP"
