		"full_text": "나이트버전은 처음 공개한 티저에서 입은 옷인데, 웬디를 제외하고 전부 흰 드레스. 어제 낮에 공개된 예리의 데이버전이 검은 드레스인것으로 미루어 봤을때 다른 멤버들도 데이버전은 검은 드레스일것으로 추측되는데, 그렇다면 웬디만 또 반대로 데이버전에 흰 드레스를 입는다면.. 좀 소름일듯. https://t.co/1V8TlMbr2E",
