		"id_str": "1205505643576098816",
		"full_text": "경찰 조사에선 팔을 이렇게 휘둘렀다고 하는데 왜 지금은 팔이 왜 이만큼 갔냐, 왼손으로 만졌다 하지만 이 자세라면 왼손을 쓰기 힘들 텐데 의심스럽다부터 기억이 또렷하면 또렷한 대로 흐릿하면 흐릿한 대로 공격받습니다. 대다수 성폭력에서 증거불충분 불기소나 무죄가 나오는 것도 이 때문이죠.",
