		"lang": "ko",
		"text": "피해자가 '당했어요'하면 유죄받는 줄 아는 멍청한 인간들이 아직도 있군요.\n\n피해자는 법원에서까지 진술조사를 수십번 반복합니다. 약간의 상식적 틈이라도 보이면 전문 변호사에게 맹공격을 받죠. 폭행이 있었을 경우는 맞은 숫자와 때리는 속도ㆍ몇분 몇초인지도 물어보는 경우가 있습니다. https://t.co/mXrbD4iCRj"
