		"text": "30대 후반 남성이 15살 여자 아이를 주먹으로 때리고, 목 조르고, '년'자 붙여가며 룸싸롱 단어로 성희롱하고, 과자 먹여주는 척 입에 손 욱여넣는 것이 방송되었음에도 EBS는 가해남성을 감싸고 있다는건 EBS가 미성년자 여성이 가학적인 콘텐츠로 소비되는걸 묵과하고 있다고 봐도 무방한거 아닌가."
