		"text": "새소년이 지금 가지고 있는 모든 것을 보여드리겠습니다. 내일 뵙겠습니다!\n⠀\n#새소년 #SESONEON #단독 #콘서트 #2020NEON https://t.co/YhgyaPwHAT"
