		"full_text": "‘시간의 바깥’\n긴긴 서사를 거쳐 비로소 첫 줄로 적혀\n나 두려움 따윈 없어\n\n과거의 노래들이 쌓이고 쌓여 그의 역사가 된 이 지금, 아이유는 비로소 다가올 시간 속의 자신을 말한다. 지나온 시간이 아니라 바로 지금의 나, 과거에 대한 이해 대신 아무것도 적혀 있지 않은 세상에서 첫 줄을 적는 나.",
